function possibleValues(e,s){for(var o=e.length-1;s/e[o]<1;)o-=1;var r=s%e[o],l=s-r,u=[];u.push(s);var a=0,n=1;for(i=0;i<=e.length-1;i++){if(e[i]<r)for(a=e[i],n=1;a<r;)a=e[i]*n,n+=1;else if(0==r)for(a=e[i],n=1;a<s;)a=e[i]*n,n+=1;else e[i]>=r&&(a=e[i]);var t=0;t=a>=s?a:l+a,u.includes(t)||u.push(t)}return u.sort(sortNumber),u}function sortNumber(e,s){return e-s}var PossibleValuesBankNote={possibleValues:possibleValues};window.PossibleValuesBankNote=PossibleValuesBankNote;